function zu(){zu=function(){};yu=tf();yu.u("api-design",'<h1>API design</h1><p>PatternFly Java integrates with and builds upon Elemento\'s <a href="https://github.com/hal/elemento#builder-api">builder API</a>. Static factory methods are used to create the components, and public instances methods add child elements and modify the component.</p><p>In general, the API for a component can be classified into these groups:</p><h2>Static factory methods</h2><p>These methods are used to create a component. They are usually named after the component, are overloaded to accept required and optional arguments, and return an instance of the newly created component:</p><pre><code class="language-java">Button button1 = button(&quot;Click me!&quot;);\nButton button2 = button(&quot;PatternFly&quot;, &quot;https://www.patternfly.org&quot;);\n</code></pre><h2>Add methods</h2><p>These methods add subcomponents to a main component. They are usually called <code>add&lt;SubComponent&gt;()</code> and return the main component so that the method call can be chained with other methods.</p><pre><code class="language-java">Dropdown dropdown = dropdown()\n        .addToggle(menuToggle(&quot;Dropdown&quot;))\n        .addMenu(menu()\n                .addContent(menuContent()\n                        .addList(menuList()\n                                .addItem(actionMenuItem(&quot;item-0&quot;, &quot;Action&quot;))))))\n</code></pre><h2>Builder / modifier methods</h2><p>These methods modify the current component. They return the current component so that the method call can be chained with other methods.</p><pre><code class="language-java">Card card = card()\n        .flat()\n        .rounded()\n        .large();\n</code></pre><h2>ARIA-related methods</h2><p>These methods set ARIA-related attributes in the component. They\'re usually named <code>aria&lt;Attribute&gt;()</code> and return the component so that the method call can be chained with other methods.</p><pre><code class="language-java">Navigation navigation = navigation(flat)\n        .ariaScrollBackLabel(&quot;\u2190 back&quot;)\n        .ariaScrollForwardLabel(&quot;\u2192 forward&quot;);\n</code></pre><h2>Event handlers</h2><p>These methods add event handlers for various event to the component. They are usually named <code>on&lt;Event&gt;()</code>, accept an event handler, and return the component so that the method call can be chained with other methods. PatternFly Java defines some <a href="https://patternfly-java.github.io/apidocs/org/patternfly/handler/package-summary.html">common event handlers</a> that are reused in all components. In some cases, components also use specific event handlers that only apply to the component.</p><pre><code class="language-java">Drawer drawer = drawer().id(&quot;drw&quot;)\n        .onToggle((e, c, expanded) -&gt; console.log(&quot;Drawer expanded: &quot; + expanded));\n</code></pre><h2>Public API / getters</h2><p>These methods do something with the component or return a value, a property, or some other kind of information. They return either <code>void</code> or a value/property.</p><pre><code class="language-java">Switch switch_ = switch_(&quot;id&quot;, &quot;name&quot;);\nboolean value = switch_.value();\n</code></pre><h2>Common interfaces</h2><hr /><p>The best way to experience the API is to browse the code snippets of the <a href="components/all-components">components</a> and <a href="layouts/about-layouts">layouts</a> in this showcase.</p>');yu.u("get-involved",
'<h1>Get involved</h1><p>PatternFly Java is still under development. The API might change, and things might not work as expected. Please give it a try and share your feedback. Join the <a href="https://app.gitter.im/#/room/#pf4-java_core:gitter.im">chat</a>, enter the <a href="https://github.com/orgs/patternfly-java/discussions">discussions</a> or use the GitHub <a href="https://github.com/patternfly-java/patternfly-java/issues">issues</a> to report bugs or request new features.</p><p>Of course, you\'re welcome to <a href="CONTRIBUTING.md">contribute</a> to PatternFly Java. If you like what you\'re seeing, leave us a star!</p>');
yu.u("get-started",'<h1>Get started</h1><p>PatternFly Java is available on <a href="https://central.sonatype.com/search?q=g%3Aorg.patternfly">Maven Central</a>. The easiest way is to import its BOM</p><pre><code class="language-xml">&lt;dependencyManagement&gt;\n    &lt;dependencies&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;org.patternfly&lt;/groupId&gt;\n            &lt;artifactId&gt;patternfly-java-bom&lt;/artifactId&gt;\n            &lt;version&gt;0.2.2&lt;/version&gt;\n            &lt;type&gt;pom&lt;/type&gt;\n            &lt;scope&gt;import&lt;/scope&gt;\n        &lt;/dependency&gt;\n    &lt;/dependencies&gt;\n&lt;/dependencyManagement&gt;\n</code></pre><p>and add a dependency to either</p><pre><code class="language-xml">&lt;dependency&gt;\n    &lt;groupId&gt;org.patternfly&lt;/groupId&gt;\n    &lt;artifactId&gt;patternfly-java-gwt&lt;/artifactId&gt;\n&lt;/dependency&gt;\n</code></pre><p>or</p><pre><code class="language-xml">&lt;dependency&gt;\n    &lt;groupId&gt;org.patternfly&lt;/groupId&gt;\n    &lt;artifactId&gt;patternfly-java-j2cl&lt;/artifactId&gt;\n&lt;/dependency&gt;\n</code></pre><p>depending on your stack. If you\'re using GWT, inherit from <code>org.patternfly.PatternFly</code>:</p><pre><code class="language-xml">&lt;module&gt;\n    &lt;inherits name=&quot;org.patternfly.PatternFly&quot;/&gt;\n&lt;/module&gt;\n</code></pre><h2>Dependencies</h2><p>PatternFly Java has <strong>no JavaScript</strong> dependencies. Everything necessary is included in the code base for both GWT and J2CL. However, Patternfly Java does <strong>not</strong> come with <strong>stylesheets</strong>. You are expected to include or bundle the necessary stylesheets yourself. Take a look at the PatternFly <a href="https://www.patternfly.org/get-started/develop#htmlcss">getting started guide</a> for more information.</p><p>You can also take a look at the code of the <a href="https://github.com/patternfly-java/patternfly-java/tree/main/showcase#readme">showcase</a> to see how to set up and use PatternFly Java.</p><h1>Modules</h1><p>PatternFly Java consists of these Maven modules (a-z):</p><table><thead><tr><th>Module</th><th>Description</th></tr></thead><tbody><tr><td>patternfly-java-bom</td><td>Bill of materials</td></tr><tr class="intellij-row-even"><td>patternfly-java-codeeditor</td><td>PatternFly codeeditor</td></tr><tr><td>patternfly-java-components</td><td>PatternFly components</td></tr><tr class="intellij-row-even"><td>patternfly-java-core</td><td>Core PatternFly Java classes</td></tr><tr><td>patternfly-java-finder</td><td>PatternFly Java Finder extension</td></tr><tr class="intellij-row-even"><td>patternfly-java-gwt</td><td>PatternFly Java for GWT</td></tr><tr><td>patternfly-java-icons</td><td>PatternFly Java icons</td></tr><tr class="intellij-row-even"><td>patternfly-java-j2cl</td><td>PatternFly Java for J2CL</td></tr><tr><td>patternfly-java-layouts</td><td>PatternFly Java layouts</td></tr></tbody></table><p>Here\u2019s the dependency graph of these maven modules and its external dependencies:</p><p><img src="https://raw.githubusercontent.com/patternfly-java/patternfly-java/main/dependency-graph.png" alt="Dependency graph" /></p>');
yu.u("icons",'<h1>Icons</h1><p>PatternFly Java comes with predefined icons for</p><ul><li>FontAwesome brand (<a href="https://fontawesome.com/search?o=r&amp;m=free&amp;f=brands">fab</a>)</li><li>FontAwesome regular (<a href="https://fontawesome.com/search?o=r&amp;m=free&amp;s=regular">far</a>)</li><li>FontAwesome solid (<a href="https://fontawesome.com/search?o=r&amp;m=free&amp;s=solid">fas</a>) and</li><li>PatternFly icons (<a href="https://www.patternfly.org/design-foundations/icons/#patternfly-icons">patternfly</a>)</li></ul><p>There are static factory methods in <a href="https://patternfly-java.github.io/apidocs/org/patternfly/icon/IconSets.html"><code>IconsSets</code></a> to easily use these icons. The icons are returned as instances of the <a href="https://patternfly-java.github.io/apidocs/org/patternfly/icon/PredefinedIcon.html"><code>PredefinedIcon</code></a> class, which is essentially an instance of an SVG builder and allows easy customization of the returned icon.</p><p>Components that support icons usually implement the interface <a href="https://patternfly-java.github.io/apidocs/org/patternfly/component/WithIcon.html"><code>WithIcon</code></a> or <a href="https://patternfly-java.github.io/apidocs/org/patternfly/component/WithIconAndText.html"><code>WithIconAndText</code></a> and thus use a common API.</p><pre><code class="language-java">import static org.patternfly.component.IconPosition.start;\nimport static org.patternfly.icon.IconSets.fas.book;\nimport static org.patternfly.icon.IconSets.fas.cube;\nimport static org.patternfly.icon.IconSets.fas.flag;\nimport static org.patternfly.icon.IconSets.fas.globe;\nimport static org.patternfly.icon.IconSets.fas.plusCircle;\nimport static org.patternfly.icon.IconSets.patternfly.key;\n\nDescriptionList dl = descriptionList()\n        .addGroup(descriptionListGroup()\n                .addTerm(descriptionListTerm(&quot;Name&quot;).icon(cube()))\n                .addDescription(descriptionListDescription(&quot;Example&quot;)))\n        .addGroup(descriptionListGroup()\n                .addTerm(descriptionListTerm(&quot;Namespace&quot;).icon(book()))\n                .addDescription(descriptionListDescription()\n                        .add(a(&quot;#&quot;).textContent(&quot;mary-test&quot;))))\n        .addGroup(descriptionListGroup()\n                .addTerm(descriptionListTerm(&quot;Labels&quot;).icon(key()))\n                .addDescription(descriptionListDescription(&quot;example&quot;)))\n        .addGroup(descriptionListGroup()\n                .addTerm(descriptionListTerm(&quot;Pod selector&quot;).icon(globe()))\n                .addDescription(descriptionListDescription()\n                        .add(button().iconAndText(plusCircle(), &quot;app=MyApp&quot;, start)\n                                .inline().link())))\n        .addGroup(descriptionListGroup()\n                .addTerm(descriptionListTerm(&quot;Annotation&quot;).icon(flag()))\n                .addDescription(descriptionListDescription(&quot;2 annotations&quot;)));\n</code></pre><p>See also the PatternFly website about <a href="https://www.patternfly.org/design-foundations/icons#all-icons">icons</a> to get an overview of the available icons.</p>');
yu.u("home",'<h1>PatternFly Java</h1><p>PatternFly Java is a \ud83d\udcaf Java implementation of <a href="https://www.patternfly.org/">PatternFly</a> without any JavaScript dependencies. Its goal is to provide an easy-to-use, elegant, and efficient API to build complex web applications with PatternFly in Java. PatternFly Java integrates with and builds upon Elemento\'s <a href="https://github.com/hal/elemento#builder-api">builder API</a>. It works with both GWT and J2CL. The following code snippet gives a taste of what PatternFly Java looks like:</p><pre><code class="language-java">body().add(page()\n        .addSkipToContent(skipToContent(&quot;main-id&quot;))\n        .addMasthead(masthead()\n                .addToggle(mastheadToggle())\n                .addBrand(brand(&quot;/assets/your-logo.svg&quot;), &quot;/home&quot;))\n        .addSidebar(sidebar()\n                .addBody(sidebarBody()\n                        .addNavigation(navigation(flat)\n                                .addItem(navigationItem(&quot;get-started&quot;, &quot;Get started&quot;, &quot;/get-started&quot;))\n                                .addItem(navigationItem(&quot;get-involved&quot;, &quot;Get involved&quot;, &quot;/get-involved&quot;)))))\n        .addMain(pageMain(&quot;main-id&quot;)\n                .addSection(pageMainSection()\n                        .light()\n                        .add(textContent()\n                                .add(title(1, &quot;PatternFly - Java&quot;))\n                                .add(p()\n                                        .add(a(&quot;https://github.com/patternfly-java/patternfly-java&quot;, &quot;_blank&quot;)\n                                                .textContent(&quot;PatternFly Java&quot;))\n                                        .add(&quot; is a \ud83d\udcaf Java implementation of &quot;)\n                                        .add(a(&quot;https://www.patternfly.org/&quot;, &quot;_blank&quot;)\n                                                .textContent(&quot;PatternFly&quot;))\n                                        .add(&quot; without any JavaScript dependencies based on GWT/J2CL and &quot;)\n                                        .add(a(&quot;https://github.com/hal/elemento&quot;, &quot;_blank&quot;)\n                                                .textContent(&quot;Elemento&quot;))\n                                        .add(&quot;.&quot;))))));\n</code></pre><p>PatternFly Java aims to provide almost complete support for all components, charts, extensions, and layouts. This showcase demonstrates all currently supported components and layouts. To get all the details about using PatternFly Java, look at the <a href="https://patternfly-java.github.io/apidocs/">API documentation</a>.</p>')}
